// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;
contract shop{
    string public name = "avito web3";
    uint public count = 0;
    address payable private owner = payable(0xb708dd7b157e16082bA713CB988c83f0A22177dE);
    uint private fee = 1;//1%
    struct Product{
        uint id;
        string name;
        string description;
        bool sold;
        address payable owner;
        uint price;
    }
    //events : are a way to communicate with ui and to informe any updates outnote(truffle and hardhat)
    event createdProduct(
        uint id,
        string name,
        string description,
        bool sold,
        address owner,
        uint price
    );
    event purshasedProduct(
        uint id,
        string name,
        string description,
        bool sold,
        address owner,
        uint price
    );
    mapping (uint => Product) public shopProducts;
    //function to add a product
    function createProduct(string memory _name, uint price, string memory description)public {
        require(bytes(_name).length > 0, "the name is empty");
        require(bytes(description).length > 0, "you must include a description");
        count++;
        shopProducts[count] = Product(count, _name, description, false, payable (msg.sender), price);
        emit createdProduct(count, _name, description, false, msg.sender, price);
    }
    //function to buy a product
    function purchaseProduct(uint id) public payable {
        require(id > 0 && id <= count, "this product does not exist!");
        require(msg.sender != shopProducts[id].owner, "you can't bay your own product!");
        require(msg.value >= shopProducts[id].price, "you don't have enough balance!");
        require(!shopProducts[id].sold,"product already sold");

        address payable seller = shopProducts[id].owner;
        shopProducts[id].owner = payable (msg.sender);
        shopProducts[id].sold = true;

        //transfer the fee to the owner
        uint transactionFee = (msg.value * fee) / 100;
        uint sellerAmount = msg.value - transactionFee;

        seller.transfer(sellerAmount);
        owner.transfer(transactionFee);

        emit purshasedProduct(id, shopProducts[id].name, shopProducts[id].description, true, shopProducts[id].owner, shopProducts[id].price);
    }
}
